import React from 'react'
const netflixLogo='https://upload.wikimedia.org/wikipedia/commons/0/08/Netflix_2015_logo.svg'
const smilyLogo='https://www.google.com/url?sa=i&url=https%3A%2F%2Ftwitter.com%2Fnetflixisajoke%2Fstatus%2F1032042396039737344&psig=AOvVaw2VQsoBBsX5nWB92sMVENQZ&ust=1613621121062000&source=images&cd=vfe&ved=0CAIQjRxqFwoTCPDl76aF8O4CFQAAAAAdAAAAABAD';
function NavBar() {
    return (
        <>
           <div>
               <img  src={netflixLogo} alt="netflixLogo"/>
               <img src={smilyLogo} alt="smilyLogo"/>
           </div>
        </>
    )
}

export default NavBar
